description:
London: The not too distant future. N-Gen Industries, a leading pharmaceutical company, is trying to placate a media uproar. Its new legal performance enhancer, RAK-295, has met with spectacular failure during testing, causing severe physical and allergic reactions in all 30,000 of its test subjects baring one... Angela Mills.

Our Future Has One Hope... and with Angela being the only person not to report any type of reaction, N-Gen CEO Peter White enlists Head of Security Cole, a hardened ex-mercenary, to find her and bring her in for examination...

